Lyse Langlois, &quot;The Anatomy of Ethical Leadership&quot;
Publisher: AU Press | 2011 | ISBN: 1897425740 | PDF | 136 pages | 1.79 MB

Performance at all costs, productivity without regard to consequences, and a competitive work environment: these are the ethical factors discussed in The Anatomy of Ethical Leadership, which highlights issues in workplace culture while looking into a brighter future for labour ethics.
